package com.syntax.class03;

public class doubleComparison {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		double value1 = 11;
		double value2 = 22;

		if (value1 > value2) {
			System.out.println("Double value1 is larger than value2");
		} else {
			System.out.println("Double value1 is not larger than value2");
		}
	}
}
